import './TitleType.css';
import Typewriter from 'typewriter-effect';

// Generate typing effect for titles
function TitleType({title}) {

    return (
        <div className="titleType">
            <Typewriter
                options={{
                    delay: 10
                }}
                onInit={(typewriter) => {
                    typewriter.typeString(title).start();
                }}
            />
        </div>
    );
}

export default TitleType;
